import React, { useState } from 'react';
import { Container, Typography, Button, Box } from '@mui/material';
import ShortenerPage from './components/ShortenerPage';
import StatsPage from './components/StatsPage';
import axios from 'axios';

function App() {
  const [registered, setRegistered] = useState(false);
  const [view, setView] = useState('shortener');
  const [error, setError] = useState('');
  const [success, setSuccess] = useState('');

  const handleRegistration = async () => {
    try {
      const response = await axios.post('/evaluation-service/register', {
        name: "YASA VARALAKSHHMI",
        email: "yasavaralakshmi.22@ifheindia.org",
        mobileNo: "8374509846",
        githubUsername: "yasa-varalakshmi",
        rollNo: "22STUCHH010322",
        accessCode: "bCuCFT"
      });
      setRegistered(true);
      setSuccess('Registered Successfully');
    } catch (err) {
      console.error(err);
      setError('Registration failed. Please check details.');
    }
  };

  return (
    <Container maxWidth="md" sx={{ mt: 5 }}>
      <Typography variant="h4" align="center" gutterBottom>
        React URL Shortener
      </Typography>
      {!registered ? (
        <Box textAlign="center" mt={4}>
          <Button variant="contained" onClick={handleRegistration}>
            Register to Begin
          </Button>
          {error && <Typography color="error">{error}</Typography>}
          {success && <Typography color="success.main">{success}</Typography>}
        </Box>
      ) : view === 'shortener' ? (
        <ShortenerPage onNavigate={setView} />
      ) : (
        <StatsPage onNavigate={setView} />
      )}
    </Container>
  );
}

export default App;
